import React, { Component } from 'react';
import api from './Api';


class Apicon extends Component{
    state= {
        Nomes:"",
        Descricao:"",
        DataInscricao:"",
        UltimoUpdate:"",
    }

    async componentDidMount (){
        const response = await api.get('')
        console.log(response.data)
        this.setState({ Nomes: response.data})
    }
    

    render() {

        const { nome } = this.state;
        
        return (
            <div>
                <h1>Lista da Api</h1>
            {nome.map(nome => (
                <li key={nome.nome}>
                    <h2><strong>Nome: </strong>
                    {nome.nome}</h2>
                </li>
            ))}
            </div>
        );
    }
}
export default Apicon
